 margin-bottom: 1rem\">Company provides a number of internet-based services through its platform and shall include:</p><ol class=\"list-group-numbered\" style=\" font-family: Optima, sans-serif; padding-left: 2rem; margin-bottom: 1rem; list-style-type: none; counter-reset: section 0\"><li style=\" font-family: Optima, sans-serif; padding: 3px 0px\">Posting User profile or listing for the purpose of sale/rental of property, and related property services etc.</li><li style=\" font-family: Optima, sans-serif; padding: 3px 0px\">Find a property through ace capital and its internet links.</li><li style=\" font-family: Optima, sans-serif; padding: 3px 0px\">Posting User profile or listing for the purpose of sale/rental of property, and related property services etc.</li><li style=\" font-family: Optima, sans-serif; padding: 3px 0px\">Post advertisements on ace capital.</li><li style=\" font-family: Optima, sans-serif; padding: 3px 0px\">Send advertisements and promotional messages through emails and messages.</li></ol></div></div></div>\r\n<div class=\"row\" style=\" font-family: Optima, sans-serif; --bs-gutter-x:1.5rem; --bs-gutter-y:0; display: flex; flex-wrap: wrap; margin-top: calc(var(--bs-gutter-y) * -1); margin-right: calc(var(--bs-gutter-x) * -0.5); margin-left: calc(var(--bs-gutter-x) * -0.5); color: rgb(33, 37, 41); font-size: 16px; background-color: rgb(255, 255, 255)\"><div class=\"col-md-12 col-lg-12\" style=\" font-family: Optima, sans-serif; flex: 0 0 auto; width: 1140px; max-width: 100%; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); margin-top: var(--bs-gutter-y)\"><h3 class=\"tc-heading\" style=\" font-family: &quot;Nunito Sans&quot;, sans-serif; font-weight: 600; line-height: 1.2; font-size: 17px; background-color: rgb(246, 246, 246); color: rgb(3, 129, 108); padding: 8px 12px\">Subscription Fees:</h3><div class=\"tc-content\" style=\" font-family: &quot;Nunito Sans&quot;, sans-serif; font-size: 16px; padding: 10px 12px\"><p style=\" font-family: Optima, sans-serif; margin-bottom: 1rem\">Company provides a number of internet-based services through its platform and shall include:</p><ul class=\"tc-list-style\" style=\" font-family: Optima, sans-serif; padding-left: 1rem; margin-bottom: 1rem\"><li style=\" font-family: Optima, sans-serif\">Posting User profile or listing for the purpose of sale/rental of property, and related property services etc.</li><li style=\" font-family: Optima, sans-serif\">Find a property through ace capital and its internet links.</li><li style=\" font-family: Optima, sans-serif\">Posting User profile or listing for the purpose of sale/rental of property, and related property services etc.</li><li style=\" font-family: Optima, sans-serif\">Post advertisements on ace capital.</li><li style=\" font-family: Optima, sans-serif\">Send advertisements and promotional messages through emails and messages.</li></ul></div></div></div><br /></div><br /></div><br /></div><br /></div><br /></div><br /></div><br /></div><br /></div><br /></div>', '<div><div><div><div><div><div><div><div><div><div><div><div><div><p></p><div><div><div><div><div><div>\r\n<div style=\"text-align: center;\"><br /></div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(33, 37, 41); font-family: Optima, sans-serif; font-size: 16px;\">Ace Capital is dedicated to finding the most suitable property based on the client\'s needs and expectations. Our real estate experts have years of experience and are committed to providing the finest service to our esteemed clients. We are here to guide you through the whole process and ensure that you make the best decisions possible at every stage of the process.</span></p>\r\n<div>\r\n<div style=\" font-family: Optima, sans-serif; color: rgb(33, 37, 41); font-size: 16px; background-color: rgb(255, 255, 255)\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div style=\" font-family: Optima, sans-serif\">\r\n<div class=\"row\" style=\" font-family: Optima, sans-serif; --bs-gutter-x:1.5rem; --bs-gutter-y:0; display: flex; flex-wrap: wrap; margin-top: calc(var(--bs-gutter-y) * -1); margin-right: calc(var(--bs-gutter-x) * -0.5); margin-left: calc(var(--bs-gutter-x) * -0.5)\">\r\n<div class=\"col-md-12 col-lg-12\" style=\" font-family: Optima, sans-serif; flex: 0 0 auto; width: 1140px; max-width: 100%; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); margin-top: var(--bs-gutter-y)\">\r\n<h3 class=\"pp-heading\" style=\" font-family: &quot;Nunito Sans&quot;, sans-serif; font-weight: 600; line-height: 1.2; font-size: 17px; color: rgb(3, 129, 108); padding: 8px 0px\"></h3><h2></h2><h2><span style=\"font-size: 24px; color: rgb(0, 128, 0);\">Who we do?</span></h2>\r\n<div class=\"pp-content\" style=\" font-family: &quot;Nunito Sans&quot;, sans-serif; font-size: 16px; padding: 10px 0px\">\r\n<p style=\" font-family: Optima, sans-serif; margin-bottom: 1rem\">A top-rated real estate brokerage firm that specializes in helping affluent individuals find the perfect homes and maximize their ROI. With a strong hold on the secondary market and off plans, Ace Capital\'s ultimate goal is to help buyers and sellers find mutually beneficial investments, regardless of the technical details involved. Ace Capital has a reputation for providing superior service to its clients, and its team of experienced professionals is dedicated to helping you find the perfect home. Whether they are residential or commercial properties, Ace Capital is always looking to provide the best options for its clients. Our goal is to provide our customers with the most recent information about the real estate market so that they can make informed decisions about their investments.</p>\r\n</div>\r\n<h4 class=\"pp-heading\" style=\" font-family: &quot;Nunito Sans&quot;, sans-serif; font-weight: 600; line-height: 1.2; font-size: 17px; color: rgb(3, 129, 108); padding: 8px 0px\"></h4><h2><span style=\"text-decoration-line: underline; font-size: 24px; color: rgb(0, 128, 0);\">Services</span></h2>\r\n<div class=\"pp-content\" style=\" font-family: &quot;Nunito Sans&quot;, sans-serif; font-size: 16px; padding: 10px 0px\">\r\n<p style=\" font-family: Optima, sans-serif; margin-bottom: 1rem\">Ace Capital has a stronghold on the real estate market in Dubai, thanks to its vibrant and dynamic team of professional brokers. Due to the ethics and hard work of our team of experienced brokers, we have been able to grab potential clientele willing to invest in luxurious properties in Dubai\r\n\r\n<span style=\"color: rgb(33, 37, 41); font-family: Optima, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255)\">Ace Capital has a stronghold on the real estate market in Dubai, thanks to its vibrant and dynamic team of professional brokers. Due to the ethics and hard work of our team of experienced brokers, we have been able to grab potential clientele willing to invest in luxurious properties in Dubai</span>\r\n.</p></div></div></div></div></div></div></div></div></div></div></div></div></div></div></div></div></div></div></div></div>\r\n\r\n<h4 class=\"pp-heading\" style=\" background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; font-weight: 600; line-height: 1.2; font-size: 17px; color: rgb(3, 129, 108); padding: 8px 0px\"></h4><h3></h3><h3></h3><h4><span style=\"text-decoration-line: underline; font-size: 18px; color: rgb(0, 128, 0);\">Off-plan:</span></h4><div class=\"pp-content\" style=\"color: rgb(33, 37, 41); font-size: 16px; background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; padding: 10px 0px\"><p style=\"font-family: Optima, sans-serif; margin-bottom: 1rem\">We have a selection of off-plan properties that are ideal for investment purposes. These properties can either be used to settle-in in a few years or used to enjoy as an investment keeping in mind the increase in value over time.</p></div>\r\n\r\n\r\n<h4 class=\"pp-heading\" style=\" background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; font-weight: 600; line-height: 1.2; font-size: 17px; color: rgb(3, 129, 108); padding: 8px 0px\"></h4><h3><span style=\"text-decoration-line: underline; color: rgb(0, 128, 0);\">Secondary Market:</span></h3><div class=\"pp-content\" style=\"color: rgb(33, 37, 41); font-size: 16px; background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; padding: 10px 0px\"><p style=\"font-family: Optima, sans-serif; margin-bottom: 1rem\">We can help you find a luxurious property that is ready to move into. We have a wide range of magnificently built properties that are ready to be sold.</p></div>\r\n\r\n\r\n<h4 class=\"pp-heading\" style=\" background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; font-weight: 600; line-height: 1.2; font-size: 17px; color: rgb(3, 129, 108); padding: 8px 0px\"></h4><h3><span style=\"text-decoration-line: underline; color: rgb(0, 128, 0);\">Renting/Leasing:</span></h3><div class=\"pp-content\" style=\"font-size: 16px; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; padding: 10px 0px\"><p style=\"font-family: Optima, sans-serif; margin-bottom: 1rem\">We are here to help individuals make the most of their investments. We have several options fitting different budgets. We offer quality properties and can help individuals find the right type of property depending on their needs, whether suitable for short-term or permanent residential use. We can also help renters find properties to lease. We can provide a list of potential tenants and facilitate the rental process.\r\n</p></div>\r\n<br /></div>\r\n\r\n<h4 class=\"pp-heading\" style=\" background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; font-weight: 600; line-height: 1.2; font-size: 17px; color: rgb(3, 129, 108); padding: 8px 0px\"></h4><h3><span style=\"text-decoration-line: underline; color: rgb(0, 128, 0);\">Property Management:</span></h3><div class=\"pp-content\" style=\"font-size: 16px; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; padding: 10px 0px\"><p style=\"font-family: Optima, sans-serif; margin-bottom: 1rem\">Our mission is to supervise and manage real estate properties. This includes looking after all day-to-day operations for a property including rental income, tenant complaints, and more. The number of responsibilities we will have will depend on the terms of our contract with the landlord.</p></div>\r\n<br /></div>\r\n<p>\r\n\r\n</p><h4 class=\"pp-heading\" style=\" background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; font-weight: 600; line-height: 1.2; font-size: 17px; color: rgb(3, 129, 108); padding: 8px 0px\"></h4><h3><span style=\"text-decoration-line: underline; color: rgb(0, 128, 0);\">Real Estate Advertisement/Marketing:</span></h3><div class=\"pp-content\" style=\"font-size: 16px; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255); font-family: &quot;Nunito Sans&quot;, sans-serif; padding: 10px 0px\"><p style=\"font-family: Optima, sans-serif; margin-bottom: 1rem\">We can help you promote listings as well as generate buyer leads for your property. It is a great way to reach a wider audience more effectively and easily than ever before.</p></div></div></div></div></div></div></div></div></div></div>\r\n<link rel=\"File-List\r\n\" href=\"file:///C:/Users/ADMINI~1/AppData/Local/Temp/msohtmlclip1/01/clip_filelist.xml\" />\r\n<link rel=\"themeData\r\n\" href=\"file:///C:/Users/ADMINI~1/AppData/Local/Temp/msohtmlclip1/01/clip_themedata.thmx\" />\r\n<link rel=\"colorSchemeMapping\r\n\" href=\"file:///C:/Users/ADMINI~1/AppData/Local/Temp/msohtmlclip1/01/clip_colorschememapping.xml\" /><br /></div><br /></div><br /></div><br /></div><br /></div><br /></div>', '2023-02-03 08:42:29', '2023-03-06 19:34:38');

