(42, 'DAMAC Lagoons', 0, 'DAMAC Lagoons', 'DAMAC Lagoons', 'DAMAC Lagoons', '<div><div><p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Damac is a well-known property developer that has always created beautiful homes and comes up with innovative new off-plans. Their work is often ahead of its time, and they have a reputation for creating properties that are both comfortable and stylish. DAMAC Lagoons by Damac Properties is an expansive complex of residential buildings, totaling 45 million square feet in size. It is a one of a kind project having a variety of 3, 4, and 5-bedroom townhouses and 5 to 6-bedroom villas with a lagoon. The houses are situated on a large, artificial lake. Damac successfully provides luxurious living accommodations yet again for those who can afford them. Popular with expats and wealthy locals, it is located in the heart of Dubai. It is divided into eight Mediterranean-style communities grouped around a beautiful man-made lagoon. Each cluster of the resort has its own unique theme, which reflects the amenities and services available in that area. This helps to create a more distinctive and interesting community for residents to experience.</span>\r\n<br /></p><br /></div><br /></div>', 'Golf City - Dubai - United Arab Emirates', 'To be defined', '[71]', '70', '1', '3', '2023-02-27 17:58:22', '2023-02-28 00:58:22', 'DAMAC Lagoons', 'DAMAC Lagoons', 'DAMAC Lagoons'),
(43, 'DAMAC Hills Two', 0, 'DAMAC Hills Two', 'DAMAC Hills Two', 'DAMAC Hills Two', '<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">DAMAC Hills 2 is a private residential neighborhood located in Dubai. It is a very popular location for luxury living and is known for its stunning views. Damac began the project in 2014, which was a few years ago. This high-end development, also known as AKOYA O2, is Dubais first community built to be environmentally friendly.</span><br style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\" /><span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">The luxury development has world-class golf courses and lush green parks all around it. There are 10,000 villas and townhouses, 1200 apartments with one, two, and three bedrooms, and approximately 650 serviced villas. According to the Dubai Real Estate Market Report for the first half of 2020, DAMAC Hills 2 is the most popular area in Dubai.</span>\r\n<br /></p>', 'DAMAC Hills 2 - Dubai - United Arab Emirates', 'At DAMAC Hills 2 compound, clusters of thoughtfully-designed apartments, townhouses and villas are surrounded by a whole new range of experiences, attractions and conveniences. Just minutes from The Dubai Mall, Dubai International Airport and downtown areas like Business Bay and DIFC, DAMAC Hills 2 compound is a haven where residents can enjoy everything Dubai has to offer.', '[18]', '18', '1', '3', '2023-02-27 13:00:51', '2023-02-27 20:00:51', 'DAMAC Hills Two', 'DAMAC Hills Two', 'DAMAC Hills Two'),
(44, 'DAMAC Safa Two', 0, 'DAMAC Safa Two', 'DAMAC Safa Two', 'DAMAC Safa Two', '<div><div class=\"elementor-element elementor-element-46432e5 exad-sticky-section-no exad-glass-effect-no elementor-widget elementor-widget-text-editor animated fadeInUp\" data-id=\"46432e5\" data-element_type=\"widget\" data-settings=\"{&quot;_animation&quot;:&quot;fadeInUp&quot;}\" data-widget_type=\"text-editor.default\" style=\" -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: var(--flex-direction); flex-wrap: var(--flex-wrap); -webkit-box-pack: var(--justify-content); justify-content: var(--justify-content); -webkit-box-align: var(--align-items); align-items: var(--align-items); align-content: var(--align-content); gap: var(--gap); flex-basis: var(--flex-basis); -webkit-box-flex: var(--flex-grow); flex-grow: var(--flex-grow); flex-shrink: var(--flex-shrink); -webkit-box-ordinal-group: var(--order); order: var(--order); align-self: var(--align-self); position: relative; animation-duration: 1.25s; --widgets-spacing:20px; animation-name: fadeInUp; width: 510px; text-align: justify; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; background-color: rgb(251, 251, 253)\">\r\n<div class=\"elementor-widget-container\" style=\" transition: background 0.3s ease 0s, border 0.3s ease 0s, border-radius 0.3s ease 0s, box-shadow 0.3s ease 0s, -webkit-box-shadow 0.3s ease 0s\">\r\n</div></div></div>\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">DAMACs Safa Two skyscraper is a new residential tower located just across the street from Safa One. The tower is set to become a popular neighborhood attraction, with its impressive architecture and proximity to both Safa Centers. The Sheikh Zayed Road structure sits on a busy street, and the project is designed by de GRISOGONO, which is inspired by the Ruby gemstone. The 83-story DAMAC Safa Two features a modern and fluid architectural style. Safa One and Two are connected at the summit by electric cabins with spectacular views of Sheikh Zayed Road.</span>', 'DAMAC SAFA 1, Al safa park - opposite business bay - Dubai - United Arab Emirates', 'DAMAC Safa offers two types of properties: studios and apartments with a range of sizes from 400 to 1500 square feet. Included will be a floating infinity-edge pool with transparent bottom and borders, an edge walking platform with 360-degree panoramic views of Dubai, a glass slide at the top of the tower, four beach-inspired pools, and much more included in the apartment building.', '[18]', '68', '1', '3', '2023-02-28 07:24:39', '2023-02-28 14:24:39', 'DAMAC Safa Two', 'DAMAC Safa Two', 'DAMAC Safa Two'),
(45, 'DAMAC Hills one', 0, 'DAMAC Hills one', 'DAMAC Hills one', 'DAMAC Hills one', '<div><p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">The DAMAC Hills complex in Dubai is a new, self-contained community with the&nbsp;latest amenities and an appealing layout that offers an alternative to the hustle and bustle of city life.</span><br style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\" /><span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">It has Dubai homes, flats, and even a hotel, but it also contains nearly four million square feet of land with various themed leisure and activity areas, such as calm gardens and lakes, a skate park, stables, a football field, tennis courts, and more.</span>\r\n<br /></p><br /></div>', 'DAMAC Hills - Dubai - United Arab Emirates', 'A stunning collection of luxurious, ready villas and apartments in the prestigious DAMAC Hills master development. Surrounded by lush fairways of the Trump International Golf Club Dubai, each home is tastefully designed with elegant interiors, spacious rooms, and access to world-class retail and leisure spaces. Here, you come home to an exceptional setting where a world of comfort awaits you.', '[77]', '18', '1', '3', '2023-02-27 18:38:48', '2023-02-28 01:38:47', 'DAMAC Hills one', 'DAMAC Hills one', 'DAMAC Hills one'),
(46, 'Chic Tower', 0, 'Chic Tower', 'Chic Tower', 'Chic Tower', '<div><div><p><span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">With luxurious studios and one to two-bedroom apartments for sale in Business Bay, DAMAC Chic Tower offers a holistic lifestyle experience that combines restorative baths, beauty treatments, state-of-the-art gyms, residential luxury, and jeweler de GRISOGONOs distinctive interpretation of one of the worlds most beloved gemstones.</span><br /></p><br /></div><br /></div>', 'Chic Tower By De Grisogono - Dubai - United Arab Emirates', 'The main features of DAMAC Chic Tower are 7 revitalizing baths, which have been designed to extract toxins from the body and help skin glow. There is a main spa, which extends into an outdoor gym, designed to strengthen all muscle groups with calisthenic-focused equipment and training, on the buildings podium level.', '[18,19]', '69', '1', '3', '2023-03-01 11:14:11', '2023-03-01 18:14:11', 'Chic Tower', 'Chic Tower', 'Chic Tower'),
