(59, 'SOBHA HARTLAND', 0, 'SOBHA HARTLAND', 'SOBHA HARTLAND', 'SOBHA HARTLAND', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Inspiring lifestyle, comfort and luxury living in every detail,Sobha Harland is an 8 million sq. ft waterfront community of luxurious apartments, beautiful villas, and high-end townhouses.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Presenting, luxury homes that come with expanses of lush green spaces, world-class amenities and a slew of mouth-watering eateries, retail centres, and entertainment facilities.<br />Experience the new definition of luxury with Sobha Harland. Dwell in Dubais only freehold community, situated in the iconic Mohammed Bin Rashid Al Maktoum City, minutes away from the Burj Khalifa.</p>\r\n<br /></p>', 'SOBHA HARTLAND, Dubai, United Arab Emirates', 'Sobha Hartland is a residential community consisting of luxurious duplexes, villas, apartments and townhouses. Covering almost 8 million sq. ft. of land, the esteemed development is located in Mohammed Bin Rashid City, Dubai. It is one of the most anticipated and fast-selling projects by Sobha Realty offering 360 views of Dubai Canal, Downtown, Meydan Racecourse and Dubai Creek.', '[135,138]', '137', '1', '3', '2023-03-07 12:18:02', '2023-03-07 12:18:02', 'SOBHA HARTLAND', 'SOBHA HARTLAND', 'SOBHA HARTLAND'),
(60, 'DUBAI HILLS ESTATE', 0, 'DUBAI HILLS ESTATE', 'DUBAI HILLS ESTATE', 'DUBAI HILLS ESTATE', '<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Dubai Hills Estate is a unique place, developed with sustainability in mind. This meticulously designed 2,700-hectare multipurpose community will be an integral part of Dubai. The district is conveniently located between downtown Dubai and Dubai Marina, within reach of Al Khail Road, and offers quick access to the citys most famous areas and tourist attractions including Burj Khalifa. A picturesque central park with basketball and volleyball courts, childrens playgrounds, a skate park, and hiking and biking trails offer an unsurpassed range of entertainment options right in your own backyard. The community is home to Dubai Hills Golf Club and Dubai Hills Mall, which provide additional recreational options.</span>\r\n<br /></p>', 'DUBAI HILLS ESTATE, Dubai, United Arab Emirates', 'The community is home to Dubai Hills Golf Club and Dubai Hills Mall, which provide additional recreational options.', '[168,167]', '167', '1', '3', '2023-03-07 13:36:55', '2023-03-07 13:36:55', 'DUBAI HILLS ESTATE', 'DUBAI HILLS ESTATE', 'DUBAI HILLS ESTATE'),
(61, 'MARINA SHORES BY EMAAR', 0, 'MARINA SHORES BY EMAAR', 'MARINA SHORES BY EMAAR', 'MARINA SHORES BY EMAAR', '<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Looking for a stunning waterfront home in Dubai Marina? Look no further than our 53-story tower  with panoramic sea and marina views  for your perfect dream home.</span><br style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\" /><span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Marina Shores is a popular neighborhood in Dubai that offers lovely homes that allow residents to enjoy the best of life with their loved ones on the sunny coast of Dubai Marina.</span>\r\n<br /></p>', 'MARINA SHORES BY EMAAR, Dubai, United Arab Emirates', 'An ultra-chic five-bedroom penthouse crowns Marina Shores, with spacious living quarters, comfortable bedrooms, breathtaking ocean views, and the promise of unforgettable moments of fun and relaxation. The private pool and deck, with their stunning views of the endless sea, will provide you with the ultimate resort-like experience.', '[171,173]', '172', '1', '3', '2023-03-07 13:46:50', '2023-03-07 13:46:50', 'MARINA SHORES BY EMAAR', 'MARINA SHORES BY EMAAR', 'MARINA SHORES BY EMAAR'),
(62, 'GOLF HEIGHTS BY EMMAR', 0, 'GOLF HEIGHTS BY EMMAR', 'GOLF HEIGHTS BY EMMAR', 'GOLF HEIGHTS BY EMMAR', '<p>\r\n\r\n<span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Golf Heights is a Luxurious 44-story tower surrounded by lush greenery from Dubais&nbsp;<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">leading developer Emaar with 1, 2, 3, and 4-bedroom apartments, Private balconies&nbsp;<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">and terraces<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Golf Heights, a luxurious 43-story tower by one of Dubais most successful real estate&nbsp;<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">developers, Emaar Properties,<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Overlooks the esteemed Emirates Golf Club. The project will be a&nbsp;<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">part of Emirates Living, the first large-scale villa community of its sort in the Middle East,<span>&nbsp;</span></span><s