(63, 'THE COVE 2 BY EMAR', 0, 'THE COVE 2 BY EMAR', 'THE COVE 2 BY EMAR', 'THE COVE 2 BY EMAR', '<p>\r\n\r\n<span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Emaar Properties newest luxury project, The Cove 2, at Dubai Creek Harbor, offers duplexes,&nbsp;<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">townhouses with two to four bedrooms, and elegantly designed apartments with one to three&nbsp;<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">bedrooms.</span><br role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\" /><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">The luxury lifestyle at Creek Island comes with multi-storey buildings that are ready to offer its&nbsp;<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">residents and guests a new waterfront lifestyle.</span>\r\n<br /></p>', 'THE COVE 2, Dubai, United Arab Emirates', 'Experience a life that is more intuitive and intentional, where your loved ones can have a lifestyle that is elegant in every way, and care about tribute to you for the monumental decision you make to change their lives fundamentally', '[178,179]', '178', '1', '3', '2023-03-07 13:58:25', '2023-03-07 13:58:25', 'THE COVE 2 BY EMAR', 'THE COVE 2 BY EMAR', 'THE COVE 2 BY EMAR'),
(64, 'THE HIGHBURY BY ELLINGTON PROPERTIES', 0, 'THE HIGHBURY BY ELLINGTON PROPERTIES', 'THE HIGHBURY BY ELLINGTON PROPERTIES', 'THE HIGHBURY BY ELLINGTON PROPERTIES', '<p>\r\n\r\n<span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">The Highbury by Ellington Properties is a brand-new development in MBR City, Dubai that<span>&nbsp;</span></span><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">offers residents a selection of chic design studios, one- to four-bedroom apartments, and duplex</span><br role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\" /><span dir=\"ltr\" role=\"presentation\" style=\" color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">penthouses.</span>\r\n<br /></p>', 'THE HIGHBURY, Dubai, United Arab Emirates', 'By purchasing one of these opulent homes with simple and affordable payment options, you have the chance to live an amazing and unique lifestyle as a resident of this community.', '[180,181,182]', '181', '1', '3', '2023-03-07 14:04:51', '2023-03-07 14:04:51', 'THE HIGHBURY BY ELLINGTON PROPERTIES', 'THE HIGHBURY BY ELLINGTON PROPERTIES', 'THE HIGHBURY BY ELLINGTON PROPERTIES'),
(65, 'RAYA TOWNHOUSES IN ARABIAN RANCHES III', 0, 'RAYA TOWNHOUSES IN ARABIAN RANCHES III', 'RAYA TOWNHOUSES IN ARABIAN RANCHES III', 'RAYA TOWNHOUSES IN ARABIAN RANCHES III', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Collection of 2-storey townhouses in a gated community from the developer, Emaar. Panoramic<br />windows offer a picturesque view of the lush green landscape<br />The luxurious townhouses in Raya by Emaar are a recent addition to Arabian Ranches III.<br />Buyers can select from 3- &amp;amp; 4-bedroom townhouses in two different architectural styles:</p><ul style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\"><li>Classic facade offering a sense of tranquility</li><li>Modern facade adds a touch of sophistication,</li></ul>\r\n<br /></p>', 'RAYA TOWNHOUSES IN ARABIAN RANCHES III, Dubai, United Arab Emirates', 'Each townhouse is provided with a maids room with an en-suite bathroom and two parking spaces. Residents of Emaar Raya will have access to world-class amenities located right on the territory of the community.', '[183,184,185]', '183', '1', '3', '2023-03-07 14:10:50', '2023-03-07 14:10:50', 'RAYA TOWNHOUSES IN ARABIAN RANCHES III', 'RAYA TOWNHOUSES IN ARABIAN RANCHES III', 'RAYA TOWNHOUSES IN ARABIAN RANCHES III');

