CREATE TABLE `projectcategory` (
  `id` int(11) NOT NULL,
  `projectId` int(11) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `sliderImages` int(11) DEFAULT NULL,
  `subImageUrl` varchar(255) DEFAULT NULL,
  `subImageAlt` varchar(255) DEFAULT NULL,
  `subImageCaption` varchar(255) DEFAULT NULL,
  `description` longtext DEFAULT NULL,
  `short_description` longtext NOT NULL,
  `images` varchar(255) NOT NULL,
  `image` varchar(255) NOT NULL,
  `status` enum('1','0') NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `page_title` longtext NOT NULL,
  `page_description` longtext NOT NULL,
  `page_schema` longtext NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

