INSERT INTO `projectcategory` (`id`, `projectId`, `name`, `sliderImages`, `subImageUrl`, `subImageAlt`, `subImageCaption`, `description`, `short_description`, `images`, `image`, `status`, `created_at`, `updated_at`, `page_title`, `page_description`, `page_schema`) VALUES
(53, 42, 'VENICE', 0, 'VENICE', 'VENICE', 'VENICE', '<div><p>\r\n\r\n</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Venice is a residential development with 415 luxury villas in DAMAC Lagoons.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Imagine yourself falling into a luxurious Mediterranean dream. Let yourself be carried away. The real Venice is known for its beautiful and lavish villas with stunning views of the lagoons. Likewise, you will find beautiful villas in Damac Lagoon. The beauty of Venice portrayed so vividly here that you would have no idea youre not actually there, making it an unforgettable experience. You can shop at upscale retail stores and enjoy a variety of fine dining restaurants. Choose a home that looks more like a vacation home all year long, a house that will have a welcoming atmosphere, no matter what time of year it is. Enjoy the sights and sounds of Venice by spending time shopping for necessary items in boats just like locals do. The goal of the project is to offer you a unique experience that allows you to get a true feel of the city without even being there.</p>\r\n<br /><p></p><br /></div>', 'The property is situated along Hessa Street and opposite DAMAC Hills community, close to the main arterial roads, Mohammed Bin Zayed Road, Emirates Road, and Al Khail Road which means it is well connected to major roads and communities, making it easily accessible. Investing in a property like this can completely transform your life.', '[72]', '73', '1', '2023-02-27 18:19:22', '2023-02-28 01:19:22', 'VENICE', 'VENICE', 'VENICE'),
(54, 42, 'MALTA', 0, 'MALTA', 'MALTA', 'MALTA', '<div><div><p>\r\n\r\n</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Damac Lagoons Malta is one of eight clusters in the premium neighborhood from DAMAC Properties, the UAEs top developer. The cluster Malta, with its amazing amenities, may offer one the feeling of being in a sophisticated and contemporary environment. The cluster is considered the playing and learning hub of the community, as within the cluster, residents will find a wide range of interactive and entertainment amenities including water attractions, a camping island, an AR nature trail, a classroom with a sensory plaza, a discovery maze, and even an outdoor art exhibition which will be liked by both adults and children.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Sitting on white sandy beaches will emotionally transport you to Malta. Other never-before-seen amenities, such as floating cinemas and waterside cafs in a residential area, will astound you.</p>\r\n<br /><p></p><br /></div><br /></div>', 'The cluster will be appealing not just to adults because of all the luxuries, but also to the younger generation since it will have classic sports facilities such as football, cricket, volleyball, and basketball. Damac Lagoon\'s Malta brings water sports to your home, eliminating the need to travel to a real beach. Another striking feature is an Aqua library with waterproof books.', '[74,76]', '75', '1', '2023-02-27 18:33:00', '2023-02-28 01:33:00', 'MALTA', 'MALTA', 'MALTA'),
(55, 43, 'DUO Prestige Villas', 0, 'DUO Prestige Villas', 'DUO Prestige Villas', 'DUO Prestige Villas', '<p>\r\n\r\n</p>\r\n<p>\r\n\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Duo Prestige Villas at DAMAC Hills 2 represents a first-of-its-kind practical solution for todays style of living. These open-view rooftop homes with ensuite offices offer ample privacy and natural light, allowing you to be your best professional self at home. Activate a lifestyle that strikes the ultimate work/life balance!</span>', 'The outstanding designs cut out of the space, which offers a conference-styled room and personal suite exclusively crafted to meet the requirement of people in work from home needs premium modern and luxurious amenities that standardize and enhance your living aura with its captivating services at ease. The creation is of utmost focus in providing the end-users with full facilities at ease and a luxury living space in the weekend communities that suits their work from home environment and as a heavenly home.', '[18]', '18', '1', '2023-02-27 12:46:22', '2023-02-27 19:46:22', 'DUO Prestige Villas', 'DUO Prestige Villas', 'DUO Prestige Villas'),
(56, 43, 'ETERNO', 0, 'ETERNO', 'ETERNO', 'ETERNO', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Eterno at DAMAC Hills 2 plays home to spacious villas with a top floor that can be whatever you need, in a master development that has everything you want.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">With access to over 30 world-class attractions at DAMAC Hills 2, here is where the home of your dreams awaits, with the promise of more. Go on, find your place.</p>\r\n<br /></p>', 'Located at the most sought-after address locality at D2 within Dubai, flanked by one of the exclusive design amenities within the community. As well as experience hassle-free access with the major road networks that offers smooth navigation to the rest of Dubai', '[18]', '18', '1', '2023-02-27 12:53:31', '2023-02-27 19:53:31', 'ETERNO', 'ETERNO', 'ETERNO'),
(57, 43, 'UNO PREMIER VILLAS', 0, 'UNO PREMIER VILLAS', 'UNO PREMIER VILLAS', 'UNO PREMIER VILLAS', '<p><p>\r\n\r\n</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Premier Villas puts you at the centre of the action at DAMAC Hills 2  a master community inspired by unique water attractions, sports amenities and leisure experiences.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Masterfully designed with sleek lines and quality fittings, Premier Villas is where you celebrate a luxury on your terms  the perfect choice for your way of life.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">With expansive living areas, beautiful garden spaces and access to a world of wonder right from its doorsteps, Uno Premier Villas served as the DAMAC Hills 2 debut launch, adding a touch of inimitable style to everyday luxury living.</p>\r\n<br /><p></p><br /></p>', 'The amazing project offers three-bedroom villa sets in the prime location of the city. The interior and exterior designs of the villas are called the most famous in the city. Besides this, they have some extraordinary amenities that amaze the life of its people.', '[18]', '18', '1', '2023-02-27 12:50:07', '2023-02-27 19:50:07', 'UNO PREMIER VILLAS', 'UNO PREMIER VILLAS', 'UNO PREMIER VILLAS'),
(58, 43, 'VIRDIS', 0, 'VIRDIS', 'VIRDIS', 'VIRDIS', '<p><p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Damac Properties Virdis, located in Damac Hills 2, provides studio, one, two, and three-bedroom apartments with utmost comfort and convenience, as well as a world of fun and excitement just a stones throw away. Everything you may desire at your destination is all in one location. Virdis, towering from the center of DAMAC Hills 2, provides breathtaking views of the community and city from every angle. It offers beautiful exteriors, gorgeous interiors, and unrivaled facilities, making it the ideal spot to call home and investment.</span>\r\n<br /></p><br /></p>', 'Virdis, rising from the core of DAMAC Hills 2, offers stunning views over the community and the city from every aspect. It has magnificent exteriors, superb interiors, and unrivalled facilities, making it the ideal place to live and the investment youve been seeking.', '[18]', '18', '1', '2023-02-27 12:47:52', '2023-02-27 19:47:52', 'VIRDIS', 'VIRDIS', 'VIRDIS'),
(59, 45, 'Golf Gate', 0, 'Golf Gate', 'Golf Gate', 'Golf Gate', '<p><p>\r\n\r\n</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Discover Golf Gate at DAMAC Hills  luxury apartments with striking exteriors that make a statement. Sharp finishes and contemporary design make each apartment perfect for new beginnings and perfect for you.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\"><br />At Golf Gate, the signature cascade waterfall feature mesmerises and envelops the tower with soothing vibes. The rainfall shower and three stunning podium pools will become family favourite hangout spots, day or night.</p>\r\n<br /><p></p><br /></p>', 'Located in an area that offers you lush landscapes, you can enjoy a luxurious lifestyle away from all the bustle and noise of the city, yet still, be close enough for you to enjoy all the amenities. Both the interior and exterior designs of these apartments offer a great sense of harmony that will calm your heart in many ways. Elegance and comfort are the hallmarks of these apartments designed by professionals for you to live a glamorous and comfortable life.', '[18]', '18', '1', '2023-02-27 13:26:29', '2023-02-27 20:26:29', 'Golf Gate', 'Golf Gate', 'Golf Gate'),
(60, 45, 'Beverly Hills', 0, 'Beverly Hills', 'Beverly Hills', 'Beverly Hills', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Beverly Hills Drive at the Trump Estates is Californian living at its finest. Nestled within the Trump International Golf Club, it offers a truly singular lifestyle, steeped in nature, the great outdoors and the very essence of luxury.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Experience opulence as far as the eye can see, with scenic vistas from every point of direction. Take in views of lakes, soft rolling green hills, breathtaking sunsets and more.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Gardens sweep across the community, serving as natural extensions to the villas. The Active and Serene hubs gently coax you into a more outdoorsy lifestyle.</p>\r\n<br /></p>', 'As for the villas themselves, from the living and dining areas to the kitchen and beyond, the ground floor of each unit is thoughtfully designed. If you wish, it could just as easily be a cozy family space or a large hall to entertain friends. Settle into life in paradise at Beverly Hills Drive. It\'s not an address. It\'s a statement.', '[18]', '18', '1', '2023-02-27 13:22:47', '2023-02-27 20:22:47', 'Beverly Hills', 'Beverly Hills', 'Beverly Hills'),
(61, 45, 'Cavalli Estates', 0, 'Cavalli Estates', 'Cavalli Estates', 'Cavalli Estates', '<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Set in a neighbourhood renowned for its vibe of exclusivity, welcome home to a way of life that celebrates the beautiful and the breathtaking. A luxury home that can only be, Cavalli.</p>\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">These magnificent six and seven-bedroom mansions, located in the heart of DAMAC Hills, exude bold expression and unmistakable opulence, showcasing the hallmarks of classic Cavalli  true to its legacy of splendour and style.</p>', 'Crafted for the luxury connoisseurs who defy the boundaries of imagination  the great outdoors, the built-in elevator, walk-in closets, private infinity pool, the beach in your backyard, a world-class community to call your own, and much more; experience infinity when you discover 18,000 sq.ft. of sheer luxury at Cavalli Estates.', '[]', '18', '1', '2023-02-27 13:24:54', '2023-02-27 20:24:54', 'Cavalli Estates', 'Cavalli Estates', 'Cavalli Estates'),
(62, 48, 'SUB ORLA', 0, 'SUB ORLA', 'SUB ORLA', 'SUB ORLA', '<p>\r\n\r\n<span style=\"color: rgb(33, 37, 41); font-family: Optima, sans-serif; font-size: 16px; background-color: rgb(248, 248, 248)\">Situated at the pinnacle of Palm Jumeirah, one of the worlds most celebrated and sought-after addresses, Orla is the latest visionary development by OMNIYAT, offering you a bespoke lifestyle steeped in sumptuous style and sophistication.</span>\r\n<br /></p>', 'Each of ORLAs residences float above the resort and shimmering sea  with unique layouts spread over one or two storeys, ensuring the best use of each space, and providing an array of options to suit every residents individual desires.', '[93,94]', '95', '1', '2023-03-03 15:30:27', '2023-03-03 15:30:27', 'SUB ORLA', 'SUB ORLA', 'SUB ORLA'),
(63, 59, 'CREEK VISTAS RESERV', 0, 'CREEK VISTAS RESERV', 'CREEK VISTAS RESERV', 'CREEK VISTAS RESERV', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Creek Vistas Reserv at Sobha Hartland is a 33-story skyscraper that links you to nature as easily as it does to Downtown Dubai.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">These apartments provide more in every way, whether its convenience, centrality, or comfort. Get accustomed to waking up to breathtaking vistas of the citys most important landmarks. Spend valuable time with your family exploring the 2.4 million-square-foot green estate. ft. Even within your flat, space has been properly utilized, making the living rooms spacious.</p>\r\n<br /></p>', 'When a business transaction needs to be completed, know that Downtown Dubai is merely minutes away.', '[141,142]', '140', '1', '2023-03-07 12:24:56', '2023-03-07 12:24:56', 'CREEK VISTAS RESERV', 'CREEK VISTAS RESERV', 'CREEK VISTAS RESERV'),
(64, 59, 'TRANQUILITY', 0, 'TRANQUILITY', 'TRANQUILITY', 'TRANQUILITY', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Tranquility is a new development launched by Sobha Group and features 26 limited edition villa plots, within Sobha Hartland in Dubai. Choose from a fine mix of waterfront &amp; forest villa plots that are primed to offer a unique blend of urban lifestyle with contemporary design.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">The 9 waterfront plots and 17 forest villa plots are made available in sizes ranging from 5000 sq.ft-8,700 sq.ft and are now being offered with attractive payment plans. The development also presents buyers the opportunity to customize the layout and the overall design of the homes. In a way, the project offers everything that one looks for  peace of mind and security.</p>\r\n<br /></p>', 'With easy access to some of the key landmarks and because of the excellent connectivity options, the residential project is poised to become the next address of choice for those select few that revel in living the high-luxury life.', '[146,144,143]', '145', '1', '2023-03-07 12:30:37', '2023-03-07 12:30:37', 'TRANQUILITY', 'TRANQUILITY', 'TRANQUILITY'),
(65, 59, 'ONE PARK AVENUE', 0, 'ONE PARK AVENUE', 'ONE PARK AVENUE', 'ONE PARK AVENUE', '<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">One Park Avenue is a 28-storey residential building under development in Sobha Hartland, Mohammed Bin Rashid City, Dubai. All apartments have balconies overlooking Dubai Creek, Downtown Dubai, Ras Al Khor Wildlife Sanctuary, Dubai Water Canal and Meydan Racecourse. Buyers can choose from a selection of layouts, all with contemporary-style interiors, fully fitted kitchens and built-in wardrobes. Facilities and amenities include motion sensor lighting in the common areas to help save electricity, dedicated electric car spaces with charging stations in the underground car park, specially designed noise-cancelling faades, and six Sky Gardens providing landscaped vertical spaces that are ideal for lounging, yoga sessions, or outdoor cinema viewing.</span>\r\n<br /></p>', 'Live in one of the newest luxurious projects offering 1BR, 2BR, 3BR & 4BR apartment units with a variety of benefits provided exclusively for you to create your own dream lifestyle and also offers a best payment plan. These classy apartments have been considered to give you your desired home', '[148,149]', '147', '1', '2023-03-07 12:38:18', '2023-03-07 12:38:18', 'ONE PARK AVENUE', 'ONE PARK AVENUE', 'ONE PARK AVENUE'),
(66, 59, 'GARDEN HOUSES', 0, 'GARDEN HOUSES', 'GARDEN HOUSES', 'GARDEN HOUSES', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Garden Houses by Sobha Group features an impressive collection of 3-level multitiered luxury infused 4 bedroom townhouses at Sobha Hartland in MBR City Dubai. The beautifully designed homes combine stylish design with exclusive interiors and modern lifestyle amenities.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">The coveted townhouses are primed to offer the best of living experience. For those with a taste for a cosmopolitan and refined lifestyle, the units seem like a perfect choice. Each unit in this development feature three- naturally lit wide set levels of pure luxury, convenience, and comfort.</p>\r\n<br /></p>', 'Moreover, the high -quality fit and finish, in addition to contemporary design give the homes a distinct identity. Offering majestic views of the surrounding landscape and flanked by plenty of green and open space, the townhouses ensure to provide the best in class security and safety.', '[151,152]', '150', '1', '2023-03-07 12:42:58', '2023-03-07 12:42:58', 'GARDEN HOUSES', 'GARDEN HOUSES', 'GARDEN HOUSES'),
(67, 59, 'WATER CANAL VILLAS', 0, 'WATER CANAL VILLAS', 'WATER CANAL VILLAS', 'WATER CANAL VILLAS', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Water Canal Villas at Sobha Hartland in MBR City is an impressive residential development featuring modern and contemporary 6 bedroom units with customizable layouts on request Designed for bespoke living on Dubais canal front, the 23 limited edition villas are made available to discerning buyers with attractive payment plans.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">For the convenience of residents, the units of this highly acclaimed property are laced with amenities that are second to none. Offering stunning views of the waterfront, the project aims to redefine the notion of comfort and luxury.</p>\r\n<br /></p>', 'Situated a few distances away from the vibrant promenade of Dubais water canal, the residents will be spoilt for choice with a fine array of dining options, retail outlets, and entertainment venues.', '[152,151]', '153', '1', '2023-03-07 12:52:13', '2023-03-07 12:52:13', 'WATER CANAL VILLAS', 'WATER CANAL VILLAS', 'WATER CANAL VILLAS'),
(68, 59, 'WAVES GRANDE', 0, 'WAVES GRANDE', 'WAVES GRANDE', 'WAVES GRANDE', '<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Waves Grande continues the success story of the 1st Waves tower with similar design principles. The northwest facing apartments in the tower are oriented directly towards Downtown, while the south-eastern units face diagonally towards an extended waterfront view.</span>\r\n<br /></p>', 'It flanks the waterfront to create a clear line of sight, with waterfront units located right at the edge. Prepare to be distracted by views that never cease to amaze.', '[157,158]', '156', '1', '2023-03-07 12:58:32', '2023-03-07 12:58:32', 'WAVES GRANDE', 'WAVES GRANDE', 'WAVES GRANDE'),
(69, 59, 'FOREST VILLAS', 0, 'FOREST VILLAS', 'FOREST VILLAS', 'FOREST VILLAS', '<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">The most exclusive development at Sobha Hartland, Hartland Forest Villas embrace the beauty of natural living with modern-day luxuries at every corner. Immersed in mesmerizing forest scenery and leafy greens, the gated community provides an ultra-private experience unmatched anywhere else. With features such as floor-to-ceiling windows that offer magnificent panoramas of the surrounding forestry, the villas truly blend the wealth and energy of the natural outdoors with the best of our contemporary world.</span>\r\n<br /></p>', 'Forest Villas feature customizable facades with varying colours, unobstructed views of the forest, as well as additional amenities upon request, such as a glass-door car gallery that adds a breath of opulence and customization. Each villa holds private service access and a private lift (Only in 5 bedroom villas) exclusive to its residents, allowing you and your guests to navigate the spacious interior with optimal luxury, comfort and ease', '[160,161]', '159', '1', '2023-03-07 13:24:35', '2023-03-07 13:24:35', 'FOREST VILLAS', 'FOREST VILLAS', 'FOREST VILLAS'),
(70, 59, 'HARTLAND GREENS', 0, 'HARTLAND GREENS', 'HARTLAND GREENS', 'HARTLAND GREENS', '<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Hartland Greens includes a stunning collection of 6 mid-rise buildings at Sobha Hartland in MBR City, which offers luxury 1, 2, and 3 bedroom apartments with starting price from AED 1.3 MN. It offers a pleasant blend of serene green landscape with the charm of urban life.</span>\r\n<br /></p>', 'The residential building set inside the huge open spaces and surrounded by nature. The housing project is located in one of the most exciting districts of the state, where you can choose a house that is specially designed by selecting a unique style.', '[163,164,166]', '165', '1', '2023-03-07 13:30:31', '2023-03-07 13:30:31', 'HARTLAND GREENS', 'HARTLAND GREENS', 'HARTLAND GREENS'),
(71, 60, 'HILLCREST (ADDRESS VILLAS)', 0, 'HILLCREST (ADDRESS VILLAS)', 'HILLCREST (ADDRESS VILLAS)', 'HILLCREST (ADDRESS VILLAS)', '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Emaar Properties has developed Villas Hillcrest, a residential complex that is popular with residents. The project is located in the Dubai Hills Estate community, which is a well-planned and multi-purpose community that is perfect for residents. This is a unique branded development by Address Hotels + Resorts.</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">&nbsp;</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Payment plan: 80/20</p><p style=\" margin-bottom: 1rem; color: rgb(34, 34, 34); font-family: Montserrat; font-size: 16px; text-align: justify; background-color: rgb(251, 251, 253)\">Handover: Q2 2026</p>\r\n<br /></p>', 'The homes are placed around a man-made lake, making this the first waterfront property in Dubai Hills. It is strategically located, making it convenient for residents to get to Dubai Hills Mall, Dubai Hills Park, and the Dubai Hills Golf Club.', '[169,170]', '170', '1', '2023-03-07 13:41:43', '2023-03-07 13:41:43', 'HILLCREST (ADDRESS VILLAS)', 'HILLCREST (ADDRESS VILLAS)', 'HILLCREST (ADDRESS VILLAS)');

