(326, 31, '59', '66', '4 BEDROOM TOWNHOUSE - GARDEN HOUSES', 22, 'Dubai - United Arab Emirates', NULL, NULL, NULL, '[221,222]', NULL, '<p>\r\n\r\n<span style=\" font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">Garden villas are the name of the townhouses in Sobha Hartland. Each townhouse is coming with 3 floors and a built-in lift and having 4 bedrooms. The kitchen is coming fully fitted with Siemens appliances like stove, oven, dishwashing machine, fridge, freezer, and a washing machine. The kitchen is manufactured by German suppliers using high-quality materials and luxury glossy finishes. The windows are having double glazing ensuring good acoustic insulation as well as control on heat.</span><br style=\" font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\" /><span style=\" font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">Smart home technology  control the house temperature, lightening and speakers from a small iPad device. Just behind the townhouses, you have the 2 British international schools and opposite the townhouse, you will have literally a forest in the middle of the city.</span>\r\n<br /></p>', '1000', '1000', 4, 2, '', NULL, 0, '0', 'Buy', '1', '0', 23, '2023-03-08 20:24:54', '2023-03-08 20:24:54', '4 BEDROOM TOWNHOUSE - GARDEN HOUSES', '4 BEDROOM TOWNHOUSE - GARDEN HOUSES', '4 BEDROOM TOWNHOUSE - GARDEN HOUSES'),
(327, 31, '59', '66', '6 BEDROOM VILLA - WATER CANAL VILLAS', 30, 'Water Canal Villas, United Arab Emirates', NULL, NULL, NULL, '[223]', NULL, '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">Canal is a highly unique place for a select few who wish high-luxury life. Canal is set to be 1your little piece of paradise where you can breathe in your beautiful backyard, walk down the canal front promenade, arrive in your private yacht, and take your luxury lifestyle to new heights. In addition, Canal Villas are located in a thriving community that overlooks the breathtaking views of the Dubai Water Canal front. As well as these, Canal offers other incredible features making it among the most desirable projects in Dubai!</p><p style=\" margin-bottom: 1rem; font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">The wonderful villas of Canal are beautifully surrounded by lush green landscapes to simply instill the sense of privacy. Also, all villas are separated by lush greenery in order to ensure complete privacy. Besides, a private pool adds a touch of tranquility to these amazing villas.</p>\r\n<br /></p>', '3000', '4000', 6, 2, '', NULL, 0, '0', 'Buy', '1', '0', 23, '2023-03-08 20:28:44', '2023-03-08 20:28:44', '6 BEDROOM VILLA - WATER CANAL VILLAS', '6 BEDROOM VILLA - WATER CANAL VILLAS', '6 BEDROOM VILLA - WATER CANAL VILLAS'),
(328, 31, '59', '69', '6 BEDROOM VILLA - FOREST VILLAS', 30, 'Forest Villas, United Arab Emirates', NULL, NULL, NULL, '[224]', NULL, '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">The central location with great connectivity options makes this residential project a sought after address in Dubai. An investment-friendly development, the villa units are being made available to discerning buyers with attractive and convenient payment plan schemes.</p><p style=\" margin-bottom: 1rem; font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">A relaxing ambiance, in addition to a high degree of security and privacy, makes it possible for you to live a happy and flawless life.</p><p style=\" margin-bottom: 1rem; font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">-Contemporary residences with sleek interiors and high-end fittings<br />-Private lifts exclusively for 5 bedroom villas<br />-Set in a prime location and far away from the city<br />-Easy and attractive payment plan<br />-Part of Dubais first freehold gated residential community</p>\r\n<br /></p>', '3000', '4000', 6, 2, '', NULL, 0, '0', 'Buy', '1', '0', 23, '2023-03-08 20:42:26', '2023-03-08 20:42:26', '6 BEDROOM VILLA - FOREST VILLAS', '6 BEDROOM VILLA - FOREST VILLAS', '6 BEDROOM VILLA - FOREST VILLAS'),
(329, 31, '59', '69', '5 BEDROOM VILLA - FOREST VILLAS', 30, 'Forest Villas, United Arab Emirates', NULL, NULL, NULL, '[224]', NULL, '<p>\r\n\r\n<p style=\" margin-bottom: 1rem; font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">The central location with great connectivity options makes this residential project a sought after address in Dubai. An investment-friendly development, the villa units are being made available to discerning buyers with attractive and convenient payment plan schemes.</p><p style=\" margin-bottom: 1rem; font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">A relaxing ambiance, in addition to a high degree of security and privacy, makes it possible for you to live a happy and flawless life.</p><p style=\" margin-bottom: 1rem; font-family: Montserrat; font-size: 16px; text-align: left; background-color: rgb(255, 255, 255)\">-Contemporary residences with sleek interiors and high-end fittings<br />-Private lifts exclusively for 5 bedroom villas<br />-Set in a prime location and far away from the city<br />-Easy and attractive payment plan<br />-Part of Dubais first freehold gated residential community</p>\r\n<br /></p>', '3000', '4000', 5, 2, '', NULL, 0, '0', 'Buy', '1', '0', 23, '2023-03-08 20:44:31', '2023-03-08 20:44:31', '5 BEDROOM VILLA - FOREST VILLAS', '5 BEDROOM VILLA - FOREST VILLAS', '5 BEDROOM VILLA - FOREST VILLAS'),
